import{_ as t,a as r}from"./chunks/rtk_here_plug_gps_to_6pin_connector.DQV61SSg.js";import{_ as e,c as l,o as i,ab as o}from"./chunks/framework.CUflZczI.js";const P=JSON.parse('{"title":"HEX/ProfiCNC Here2 GPS (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/gps_hex_here2.md","filePath":"uk/gps_compass/gps_hex_here2.md"}'),a={name:"uk/gps_compass/gps_hex_here2.md"},s=o('<h1 id="hex-proficnc-here2-gps-discontinued" tabindex="-1">HEX/ProfiCNC Here2 GPS (Discontinued) <a class="header-anchor" href="#hex-proficnc-here2-gps-discontinued" aria-label="Permalink to &quot;HEX/ProfiCNC Here2 GPS (Discontinued)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This has been superseded by the <a href="https://www.cubepilot.com/#/here/here3" target="_blank" rel="noreferrer">Cube Here 3</a></p></div><p>GPS-приймач <a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">Here2</a> є оновленням GPS-модуля Here від компанії HEX.</p><p>Основні функції включають:</p><ul><li>Одночасний прийом до 3 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li>Найкраща в галузі навігаційна чутливість -167 дБм</li><li>Безпека та захист цілісності</li><li>Підтримує всі системи супутникового доповнення</li><li>Просунуте виявлення перешкод і спуфінгу</li></ul><img src="'+t+'"><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><ul><li><a href="http://www.proficnc.com/all-products/152-gps-module.html" target="_blank" rel="noreferrer">ProfiCNC</a> (Австралія)</li><li><a href="http://www.proficnc.com/stores" target="_blank" rel="noreferrer">Інші реселлери</a></li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>Налаштування та використання PX4 відбувається за принципом «підключи і працюй».</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Якщо GPS <em>не виявлено</em>, тоді <a href="https://docs.cubepilot.org/user-guides/here-2/updating-here-2-firmware" target="_blank" rel="noreferrer">оновить прошивку Here2</a>.</li><li>Якщо GPS виявлено, але він не працює, спробуйте виконати процес, описаний у пункті <a href="https://docs.cubepilot.org/user-guides/here-2/here-2-can-mode-instruction" target="_blank" rel="noreferrer">визначення вузла uavcan ID</a>.</li></ul></div><h2 id="підключення-та-з-єднання" tabindex="-1">Підключення та з&#39;єднання <a class="header-anchor" href="#підключення-та-з-єднання" aria-label="Permalink to &quot;Підключення та з&#39;єднання&quot;">​</a></h2><p>Here2 GPS постачається з 8-контактним роз&#39;ємом, який можна вставити безпосередньо в <a href="http://www.hex.aero/wp-content/uploads/2016/07/DRS_Pixhawk-2-17th-march-2016.pdf" target="_blank" rel="noreferrer">Pixhawk 2</a> GPS UART порт.</p><p>У Pixhawk 3 Pro та Pixracer є роз&#39;єм для GPS з 6 контактами. Для цих контролерів ви можете модифікувати GPS-кабель (як показано нижче), видаливши контакти 6 і 7.</p><img src="'+r+'" width="500px"><p>Виводи 6 і 7 призначені для кнопки безпеки - їх також можна прикріпити за потреби.</p><h3 id="розпіновка" tabindex="-1">Розпіновка <a class="header-anchor" href="#розпіновка" aria-label="Permalink to &quot;Розпіновка&quot;">​</a></h3><p>Схема виводів Here2 GPS наведена нижче. Це може бути використано для модифікації роз&#39;єму для інших плат автопілота.</p><table><thead><tr><th>пін</th><th>Here2 GPS</th><th>пін</th><th>Pixhawk 3 Pro GPS</th></tr></thead><tbody><tr><td>1</td><td>VCC_5V</td><td>1</td><td>VCC</td></tr><tr><td>2</td><td>GPS_RX</td><td>2</td><td>GPS_TX</td></tr><tr><td>3</td><td>GPS_TX</td><td>3</td><td>GPS_RX</td></tr><tr><td>4</td><td>SCL</td><td>4</td><td>SCL</td></tr><tr><td>5</td><td>SDA</td><td>5</td><td>SDA</td></tr><tr><td>6</td><td>BUTTON</td><td>-</td><td>-</td></tr><tr><td>7</td><td>BUTTON_LED</td><td>-</td><td>-</td></tr><tr><td>8</td><td>GND</td><td>6</td><td>GND</td></tr></tbody></table><h2 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h2><ul><li><strong>Процесор:</strong> STM32F302</li><li><strong>Сенсор</strong><ul><li><strong>Компас, Гіроскоп, Акселерометр:</strong> ICM20948</li><li><strong>Барометр:</strong> MS5611</li></ul></li><li><strong>Тип приймача:</strong> 72-канальний модуль u-blox M8N, GPS/QZSS L2 C/A, GLONASS L10F, BeiDou B11, Galileo E1B/C, SBAS L1 C/A: WAAS, EGNOS, MSAS, GAGAN</li><li><strong>Частота оновлення навігації:</strong> Max: 10 Гц</li><li><strong>Точність позиціювання:</strong> 3D Fix</li><li><strong>Час до першого виправлення:</strong><ul><li><strong>Холодний запуск:</strong> 26с</li><li><strong>Допоміжний запуск:</strong> 2с</li><li>** Повторне отримання:** 1с</li></ul></li><li><strong>Чутливість:</strong><ul><li><strong>Відстеження &amp; навігація:</strong> -167 дБм</li><li><strong>Гарячий старт:</strong> -148 dBm</li><li><strong>Холодний старт:</strong> -157 dBm</li></ul></li><li><strong>Допоміжний GNSS</strong><ul><li>AssistNow GNSS Online</li><li>AssistNow GNSS Offline (до 35 днів)</li><li>AssistNow Autonomous (до 6 днів)</li><li>OMA SUPL&amp; сумісність з 3GPP</li></ul></li><li><strong>Осцилятор:</strong> TCXO (NEO-8MN/Q)</li><li><strong>RTC кристал:</strong> Вбудований</li><li><strong>ROM:</strong> Flash (NEO-8MN)</li><li><strong>Доступні антени:</strong> Активна антена &amp; Пасивна антена</li><li><strong>Цілісність сигналу:</strong> Функція підпису з SHA 256</li><li><strong>Протоколи &amp; Інтерфейси:</strong><ul><li><strong>UART/I2C/CAN:</strong> JST_GH Головний інтерфейс, внутрішній перемикач.</li><li><strong>Основний інтерфейс програмування STM32:</strong> JST_SUR</li></ul></li></ul>',21),d=[s];function n(h,c,p,g,u,_){return i(),l("div",null,d)}const f=e(a,[["render",n]]);expor